  \"2016-07-27T23:06:21.074668\",\n\t\"name\": \"ecology-of-waterfowl-and-their-habitats-during-spring-migration-in-southern-oregon-northea\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Miller et al. (2005) defined the SONEC
  region using locations of the 77u201387% of the female northern pintails (Anas acuta)
  from the Central Valley of California equipped with satellite transmitters that
  staged there during spring migration. To guide conservation, a multi-partner program
  was developed to understand spring ecology of waterfowl and their habitats. Goals
  of the program are to: 1) survey waterfowl use, 2) map habitats using Landsat, 3)
  radiotrack habitat use and duration-of-stay of pintails, 4) determine duck food
  habits and availability, and 5) measure waterfowl body condition.\",\n\t\"license_title\":
